(1, '2023-01-05', 3, 120, 'https://garry-s-mod.ru/wp-content/uploads/2022/10/Screenshot_1-1.jpg', NULL, '. Заброшенная больничная палата, куча пустых коек, на одной из которых спит человек. Он просыпается, подходит к окну, открывает его, смотрит вдаль. Человек продолжает стоять у окна, и вдруг...', 1),
(2, '2023-01-06', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRaYNpYd-TNJ5rGdVpnXUAq3Z67vhciMZVm5qhe8OMBsQ&s', NULL, 'Рекламу услуг по ремонту компьютеров, телефонов и телевизоров предлагают разместить в вагонах метро.', 1),
(3, '2022-12-25', 0, 0, 'https://a.d-cd.net/e7b0889s-960.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 79),
(4, '2022-12-13', 0, 0, 'https://fire-steel.ru/wp-content/uploads/2021/11/platform__0003.jpg', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', NULL, 141),
(5, '2022-12-01', 0, 0, 'https://www.beton-kostroma.ru/images/beton/28gidrosoor/1200px-___.jpg', NULL, NULL, 80),
(6, '2022-11-19', 0, 0, NULL, NULL, 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 74),
(7, '2022-11-07', 0, 0, 'https://cs7.pikabu.ru/post_img/2018/09/06/3/og_og_15362054642621558.jpg', NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 21),
(8, '2022-10-26', 0, 0, 'https://gas-kvas.com/uploads/posts/2022-06/1655260487_39-gas-kvas-com-p-kotik-foto-zhivotnogo-43.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'А у меня по-прежнему все хорошо.', 15),
(9, '2022-10-14', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', NULL, 19),
(10, '2022-10-02', 0, 0, 'http://s2.fotokto.ru/photo/full/134/1341831.jpg', 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm', NULL, 28),
(11, '2022-09-20', 0, 0, 'https://proprikol.ru/wp-content/uploads/2020/09/kartinki-lep-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', 'Цветовая гамма: белый, черный.\r\nВысота: 2000 мм.\r\nШирина: 600 мм\r\n+ Стенка в гостиную  Ариадна  с фасадами МДФ\r\nГабаритные размеры ВхШхГ 2050x2950x420 мм.\r\nСтенд «Ариада» — стильный и одновременно функциональный предмет обстановки.', 3),
(12, '2022-09-08', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm', 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 10),
(13, '2022-08-27', 0, 0, 'https://s5o.ru/storage/simple/cyber/edt/00/24/73/cd/cybered8aae50a74.jpg', NULL, 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 96),
(14, '2022-08-15', 0, 0, 'https://a.d-cd.net/2abd756s-1920.jpg', 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm', 'Я хочу сделать простую функцию, которая будет читать строку из файла и возвращать все первые N слов.', 150),
(15, '2022-08-03', 0, 0, 'https://kartinkin.net/pics/uploads/posts/2022-09/1662235711_1-kartinkin-net-p-kosmicheskii-retro-futurizm-sssr-kosmos-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 24),
(16, '2022-07-22', 0, 0, NULL, NULL, 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 40),
(17, '2022-07-10', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 129),
(18, '2022-06-28', 0, 0, 'https://www.mirf.ru/wp-content/uploads/2021/02/Disco-Elysium-1.jpg', NULL, 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 97),
(19, '2022-06-16', 0, 0, 'https://ixbt.online/live/topics/preview/00/01/94/37/5d6bdf3137.jpg', 'https://www.shutterstock.com/shutterstock/videos/1066323100/preview/stock-footage-care-and-maintenance-of-animals-at-home-domestic-adorable-tabby-cat-is-eating-its-dry-food-from.webm', 'Я хочу сделать простую функцию, которая будет читать строку из файла и возвращать все первые N слов.', 43),
(20, '2022-06-04', 0, 0, NULL, NULL, 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 2),
(21, '2022-05-23', 0, 0, 'https://a.d-cd.net/EEAAAgFBM-A-960.jpg', NULL, NULL, 52),
(22, '2022-05-11', 0, 0, 'https://ixbt.online/live/topics/preview/00/01/94/37/5d6bdf3137.jpg', NULL, NULL, 132),
(23, '2022-04-29', 0, 0, 'https://i.pinimg.com/736x/b5/fa/72/b5fa721238086248ec12a59fa4c3779e.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 134),
(24, '2022-04-17', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', NULL, 29),
(25, '2022-04-05', 0, 0, 'https://img4.badfon.ru/original/4000x2507/c/aa/linii-elektroperedachi-6037.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057849519/preview/stock-footage-hd-timelapse-construction-of-a-glass-building.webm', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 32),
(26, '2022-03-24', 0, 0, 'https://max-cars.ru/wp-content/uploads/2022/07/6c0bb65a-89af-41d0-ba27-7d92c6acfc0d.jpg', NULL, 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 111),
(27, '2022-03-12', 0, 0, 'https://na-dache.pro/uploads/posts/2021-05/1620673970_5-p-panelnii-dom-foto-7.jpg', NULL, NULL, 34),
(28, '2022-02-28', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 145),
(29, '2022-02-16', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', NULL, 133),
(30, '2022-02-04', 0, 0, NULL, NULL, 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 68),
(31, '2022-01-23', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1066323100/preview/stock-footage-care-and-maintenance-of-animals-at-home-domestic-adorable-tabby-cat-is-eating-its-dry-food-from.webm', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 117),
(32, '2022-01-11', 0, 0, NULL, NULL, 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 12),
