(69, '2020-10-24', 0, 0, 'https://voms.ru/upload/iblock/959/95957d207137db849150eca86265e77d.jpg', 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 135),
