(73, '2020-09-06', 0, 0, 'https://storage.myseldon.com/news-pict-a6/A6C8D377880141003305AA9B3F31AF3B', 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 25),
