(79, '2020-06-26', 0, 0, 'https://kuznitsaspb.ru/wp-content/uploads/7/e/4/7e4de76a2777cab9650062c72d0ba43c.jpeg', NULL, 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 121),
