(131, '2018-10-11', 0, 0, 'https://fire-steel.ru/wp-content/uploads/2021/11/platform__0003.jpg', 'https://www.shutterstock.com/shutterstock/videos/1069766158/preview/stock-footage-an-aerial-drone-video-of-a-russian-made-lada-niva-x-driving-off-road-along-a-dirt-track-in.webm', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 90),
