(143, '2018-05-20', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 84),
(144, '2018-05-08', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1069766158/preview/stock-footage-an-aerial-drone-video-of-a-russian-made-lada-niva-x-driving-off-road-along-a-dirt-track-in.webm', NULL, 30),
(145, '2018-04-26', 0, 0, 'https://rasekhoon.net/_files/images/photogallery/Cats%20Wallpaper%202%20(43).jpg', NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 112),
(146, '2018-04-14', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTysfKKw4oMZJOcVnMgdbusnjFf23anvwHTncF5vgWarYu2Efzusq1rn2iC2_BPLr0kJtM&usqp=CAU', NULL, NULL, 85),
(147, '2018-04-02', 0, 0, 'https://fotorelax.ru/wp-content/uploads/2016/03/Funny-and-cute-cats-04.jpg', NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 9),
(148, '2018-03-21', 0, 0, 'https://cdnstatic.rg.ru/uploads/images/140/06/71/uaz_JP_1000.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 56),
