(167, '2022-08-03', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', 'Тренды в дизайне интерьера весна-лето 2020.\r\nВ 2020 году в тренде минимализм, эко и прованс.\r\nЕсли вы хотите попробовать дизайн интерьера в этих стилях, вот несколько идей по оформлению жилых помещений.', 24),
