(197, '2021-08-08', 0, 0, 'https://dailymoscow.ru/storage/news/2022/11/10/1e31496bf0b99e730ec1ffef86e5ef70.jpg', NULL, 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 65),
(198, '2021-07-27', 0, 0, 'https://proprikol.ru/wp-content/uploads/2020/09/kartinki-lep-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/19252600/preview/stock-footage-people-work-at-assembly-of-cars-on-conveyor-of-factory.webm', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 61),
(199, '2021-07-15', 0, 0, 'http://s2.fotokto.ru/photo/full/134/1341831.jpg', 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 71),
(200, '2021-07-03', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSb8s-Dpkfa1rrPV9WCLNylA3S8y7EH5TLUH6nD7ef7v76QBp_LSBgEDSKRoXuKs1qvxaY&usqp=CAU', NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 92),
