(202, '2021-06-09', 0, 0, 'https://195004.selcdn.ru/ref/vehicle/165739_9638394a01.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', NULL, 6),
(203, '2021-05-28', 0, 0, 'https://ждвокзалы.рф/wp-content/uploads/2019/03/snp2013_20.jpg', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 11),
