(209, '2021-03-17', 0, 0, 'https://sport-dog.ru/wp-content/uploads/2/2/d/22d41f52bb6e6e7b6b969c8601b513a0.jpeg', 'https://www.shutterstock.com/shutterstock/videos/6924577/preview/stock-footage-detail-of-rusty-old-car-orange-decay-aged-vintage-lada-chrome-pan.webm', NULL, 55),
(210, '2021-03-05', 0, 0, 'https://games.mail.ru/hotbox/content_files/Stories/2022/10/19/fe4765df7e6341f9963e5e4b4645005c.jpg', 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 87),
