(239, '2020-03-22', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', NULL, 57),
(240, '2020-03-10', 0, 0, 'https://hub.ldpr.ru/media/images/leningrad/2bb8c1d9a94c6fd75706f87dddce49990a34b14911c69adb020dbefc86dfd78a.jpg', 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 42),
(241, '2020-02-27', 0, 0, 'https://a.d-cd.net/e7b0889s-960.jpg', NULL, 'Тренды в дизайне интерьера весна-лето 2020.\r\nВ 2020 году в тренде минимализм, эко и прованс.\r\nЕсли вы хотите попробовать дизайн интерьера в этих стилях, вот несколько идей по оформлению жилых помещений.', 44),
