(243, '2020-02-03', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1080491531/preview/stock-footage-the-concrete-mixer-at-the-plant-the-concrete-mixer-at-the-industrial-plant-the-concrete-mixer.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 118),
(244, '2020-01-22', 0, 0, 'https://club.season.ru/uploads/post/3858/853/post-3858-1572343853.jpg', 'https://www.shutterstock.com/shutterstock/videos/1093912751/preview/stock-footage-lada-hitam-black-pepper-in-sedli-johor.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 41),
(245, '2020-01-10', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1093912751/preview/stock-footage-lada-hitam-black-pepper-in-sedli-johor.webm', 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 18),
(246, '2019-12-29', 0, 0, 'https://carsweek.ru/upload/resize_cache/iblock/8a0/1200_900_1/8a055f1cf1329fa717b834734790e3c6.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', NULL, 78),
(247, '2019-12-17', 0, 0, 'https://games.mail.ru/hotbox/content_files/Stories/2022/10/19/fe4765df7e6341f9963e5e4b4645005c.jpg', 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm', 'Я хочу сделать простую функцию, которая будет читать строку из файла и возвращать все первые N слов.', 37),
(248, '2019-12-05', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1066323100/preview/stock-footage-care-and-maintenance-of-animals-at-home-domestic-adorable-tabby-cat-is-eating-its-dry-food-from.webm', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 63),
(249, '2019-11-23', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 46),
(250, '2019-11-11', 0, 0, 'https://carsweek.ru/upload/resize_cache/iblock/8a0/1200_900_1/8a055f1cf1329fa717b834734790e3c6.jpg', 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', NULL, 136),
(251, '2019-10-30', 0, 0, 'https://img.zr.ru/_ah/img/1jtQE2MLzuF6NUK2VaS6CA', NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 20),
(252, '2019-10-18', 0, 0, 'http://chudo-prirody.com/uploads/posts/2021-08/1628647490_127-p-udivlennii-kot-foto-133.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057849519/preview/stock-footage-hd-timelapse-construction-of-a-glass-building.webm', NULL, 109),
(253, '2019-10-06', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 51),
