(269, '2019-03-28', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 39),
(270, '2019-03-16', 0, 0, 'https://avatars.mds.yandex.net/i?id=6fed043a5d056146a91d6066c4900318bac12f69-8277774-images-thumbs&n=13&exp=1', 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 27),
(271, '2019-03-04', 0, 0, 'https://rasekhoon.net/_files/images/photogallery/Cats%20Wallpaper%202%20(43).jpg', NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 49),
(272, '2019-02-20', 0, 0, NULL, NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 114),
(273, '2019-02-08', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-09/1662679280_6-gamerwall-pro-p-retrofuturizm-sssr-arkhitektura-vkontakte-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm', NULL, 124),
(274, '2019-01-27', 0, 0, NULL, NULL, 'Цветовая гамма: белый, черный.\r\nВысота: 2000 мм.\r\nШирина: 600 мм\r\n+ Стенка в гостиную  Ариадна  с фасадами МДФ\r\nГабаритные размеры ВхШхГ 2050x2950x420 мм.\r\nСтенд «Ариада» — стильный и одновременно функциональный предмет обстановки.', 102),
(275, '2019-01-15', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', NULL, 101),
(276, '2019-01-03', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', 'Я хочу сделать простую функцию, которая будет читать строку из файла и возвращать все первые N слов.', 94),
(277, '2018-12-22', 0, 0, 'https://i.cenyavto.com/2021/11/QlqC.jpg', 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm', 'Цветовая гамма: белый, черный.\r\nВысота: 2000 мм.\r\nШирина: 600 мм\r\n+ Стенка в гостиную  Ариадна  с фасадами МДФ\r\nГабаритные размеры ВхШхГ 2050x2950x420 мм.\r\nСтенд «Ариада» — стильный и одновременно функциональный предмет обстановки.', 36),
(278, '2018-12-10', 0, 0, NULL, NULL, NULL, 22),
(279, '2018-11-28', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'Рекламу услуг по ремонту компьютеров, телефонов и телевизоров предлагают разместить в вагонах метро.', 95),
(280, '2018-11-16', 0, 0, 'https://ixbt.online/live/topics/preview/00/01/94/37/5d6bdf3137.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057849519/preview/stock-footage-hd-timelapse-construction-of-a-glass-building.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 137),
(281, '2018-11-04', 0, 0, 'https://carsweek.ru/upload/resize_cache/iblock/8a0/1200_900_1/8a055f1cf1329fa717b834734790e3c6.jpg', 'https://www.shutterstock.com/shutterstock/videos/1066323100/preview/stock-footage-care-and-maintenance-of-animals-at-home-domestic-adorable-tabby-cat-is-eating-its-dry-food-from.webm', 'Тренды в дизайне интерьера весна-лето 2020.\r\nВ 2020 году в тренде минимализм, эко и прованс.\r\nЕсли вы хотите попробовать дизайн интерьера в этих стилях, вот несколько идей по оформлению жилых помещений.', 48),
(282, '2018-10-23', 0, 0, 'https://photos.wikimapia.org/p/00/02/90/56/34_big.jpg', NULL, 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 69),
(283, '2018-10-11', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', NULL, 90),
(284, '2018-09-29', 0, 0, 'https://million-wallpapers.ru/wallpapers/5/5/15358753003924037261/milyj-kotenok-s-podognutymi-lapkami.jpg', 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 131);
