(285, '2018-09-17', 0, 0, 'https://i.pinimg.com/736x/b5/fa/72/b5fa721238086248ec12a59fa4c3779e.jpg', NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 149),
