(288, '2018-08-12', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', NULL, 105),
