(291, '2018-07-07', 0, 0, NULL, NULL, 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 7),
(292, '2018-06-25', 0, 0, 'https://pic.rutubelist.ru/video/eb/87/eb8772e90f2d92e9fd0c6d3a9d520a7e.jpg', NULL, 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 113),
(293, '2018-06-13', 0, 0, 'https://china-cosm.ru/wp-content/uploads/2/b/2/2b28a366e7cf29ece21a9d7d00aa327d.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 4),
