(295, '2018-05-20', 0, 0, 'https://img4.badfon.ru/original/4000x2507/c/aa/linii-elektroperedachi-6037.jpg', NULL, NULL, 84),
(296, '2018-05-08', 0, 0, 'https://tn.fishki.net/26/upload/post/2016/08/18/2046804/b449271d549f7b7bf7274d6337dbd2d6.jpg', NULL, 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 30),
(297, '2018-04-26', 0, 0, NULL, 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'Эвакуация автомобилей, микроавтобусов с выездом к месту поломки в любую точку Москвы и Московской области.\r\nГрузоподъёмность до 3 тонн.', 112),
(298, '2018-04-14', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/19252600/preview/stock-footage-people-work-at-assembly-of-cars-on-conveyor-of-factory.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 85),
(299, '2018-04-02', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', NULL, 9),
(300, '2018-03-21', 0, 0, 'https://www.exutopia.com/wp-content/uploads/2015/05/Stara-Zagora-Buzludzha-16.jpg', 'https://www.shutterstock.com/shutterstock/videos/1085421791/preview/stock-footage-bengal-cat-licking-water-from-glass-creative-idea-unusual-view-shot-at-fps-from-the-bottom.webm', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 56),
(301, '2018-03-09', 0, 0, 'https://photos.wikimapia.org/p/00/06/81/21/72_full.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057849519/preview/stock-footage-hd-timelapse-construction-of-a-glass-building.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 130),
