(307, '2022-12-25', 0, 0, 'https://autozam.ru/wp-content/uploads/2019/03/post_5c80c109e73fd.jpeg', NULL, 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 79),
