(325, '2022-05-23', 0, 0, NULL, NULL, 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 52),
(326, '2022-05-11', 0, 0, 'https://i.pinimg.com/736x/b5/fa/72/b5fa721238086248ec12a59fa4c3779e.jpg', 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 132),
