(373, '2020-10-24', 0, 0, 'https://img.zr.ru/_ah/img/1jtQE2MLzuF6NUK2VaS6CA', NULL, 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 135),
(374, '2020-10-12', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', NULL, 151),
(375, '2020-09-30', 0, 0, NULL, NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 126),
