(377, '2020-09-06', 0, 0, 'https://img4.badfon.ru/original/4000x2507/c/aa/linii-elektroperedachi-6037.jpg', 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'Рекламу услуг по ремонту компьютеров, телефонов и телевизоров предлагают разместить в вагонах метро.', 25),
(378, '2020-08-25', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 38),
(379, '2020-08-13', 0, 0, 'https://kartinkin.net/pics/uploads/posts/2022-09/thumbs/1662235680_12-kartinkin-net-p-kosmicheskii-retro-futurizm-sssr-kosmos-14.jpg', 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 86),
(380, '2020-08-01', 0, 0, 'https://www.mirf.ru/wp-content/uploads/2021/02/Disco-Elysium-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 123),
(381, '2020-07-20', 0, 0, 'https://img.zr.ru/_ah/img/1jtQE2MLzuF6NUK2VaS6CA', 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm', 'Чек-лист: как избежать ошибок при составлении резюме.', 91),
(382, '2020-07-08', 0, 0, 'https://games.mail.ru/hotbox/content_files/Stories/2022/10/19/fe4765df7e6341f9963e5e4b4645005c.jpg', 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 100),
