(388, '2020-04-27', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1085421791/preview/stock-footage-bengal-cat-licking-water-from-glass-creative-idea-unusual-view-shot-at-fps-from-the-bottom.webm', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 77),
(389, '2020-04-15', 0, 0, 'https://a.d-cd.net/EEAAAgFBM-A-960.jpg', 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 17),
(390, '2020-04-03', 0, 0, 'https://www.beton-kostroma.ru/images/beton/28gidrosoor/1200px-___.jpg', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 50),
(391, '2020-03-22', 0, 0, 'https://a.d-cd.net/tQAAAgPwCOA-960.jpg', 'https://www.shutterstock.com/shutterstock/videos/1069766158/preview/stock-footage-an-aerial-drone-video-of-a-russian-made-lada-niva-x-driving-off-road-along-a-dirt-track-in.webm', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 57),
