(413, '2019-07-02', 0, 0, 'https://fikiwiki.com/uploads/posts/2022-02/1645018228_1-fikiwiki-com-p-kartinki-lep-2.jpg', NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 35),
(414, '2019-06-20', 0, 0, NULL, NULL, NULL, 119),
(415, '2019-06-08', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 125),
(416, '2019-05-27', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 88),
(417, '2019-05-15', 0, 0, 'https://i.cenyavto.com/2021/11/QlqC.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 103),
(418, '2019-05-03', 0, 0, 'https://s5o.ru/storage/simple/cyber/edt/00/24/73/cd/cybered8aae50a74.jpg', NULL, 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 143),
(419, '2019-04-21', 0, 0, NULL, NULL, NULL, 45),
(420, '2019-04-09', 0, 0, 'https://wildfrontier.ru/wp-content/uploads/2015/09/Kapibara6.jpg', 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', NULL, 140),
(421, '2019-03-28', 0, 0, NULL, NULL, 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 39),
(422, '2019-03-16', 0, 0, NULL, NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 27),
(423, '2019-03-04', 0, 0, NULL, NULL, 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 49),
(424, '2019-02-20', 0, 0, 'https://kartinkin.net/pics/uploads/posts/2022-09/thumbs/1662235680_12-kartinkin-net-p-kosmicheskii-retro-futurizm-sssr-kosmos-14.jpg', NULL, 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 114),
(425, '2019-02-08', 0, 0, 'https://fikiwiki.com/uploads/posts/2022-02/1645018228_1-fikiwiki-com-p-kartinki-lep-2.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 124),
(426, '2019-01-27', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 102),
(427, '2019-01-15', 0, 0, 'https://perevozki-stolitsa.ru/wp-content/uploads/2019/04/Novaya-Buhanka-UAZ-Kombi-Trofi.jpg', 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 101),
