(475, '2022-06-16', 0, 0, 'https://fire-steel.ru/wp-content/uploads/2021/11/platform__0003.jpg', 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 43),
