(498, '2021-09-13', 0, 0, 'https://perevozki-stolitsa.ru/wp-content/uploads/2019/04/Novaya-Buhanka-UAZ-Kombi-Trofi.jpg', NULL, 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 66),
