(553, '2019-11-23', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 46),
