(555, '2019-10-30', 0, 0, NULL, NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 20),
(556, '2019-10-18', 0, 0, 'https://nashagazeta.ch/sites/default/files/3_c_javier_miguel_valerme.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm', 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 109),
(557, '2019-10-06', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm', 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 51),
