(559, '2019-09-12', 0, 0, 'https://fire-steel.ru/wp-content/uploads/2021/11/platform__0003.jpg', 'https://www.shutterstock.com/shutterstock/videos/1080491531/preview/stock-footage-the-concrete-mixer-at-the-plant-the-concrete-mixer-at-the-industrial-plant-the-concrete-mixer.webm', 'Тренды в дизайне интерьера весна-лето 2020.\r\nВ 2020 году в тренде минимализм, эко и прованс.\r\nЕсли вы хотите попробовать дизайн интерьера в этих стилях, вот несколько идей по оформлению жилых помещений.', 14),
