(569, '2019-05-15', 0, 0, 'https://fire-steel.ru/wp-content/uploads/2021/11/platform__0003.jpg', NULL, 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 103),
(570, '2019-05-03', 0, 0, 'https://www.zr.ru/d/story/c3/917443/57839949_2015562468554141_1595085059130392576_o.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 143),
(571, '2019-04-21', 0, 0, 'https://www.beton-kostroma.ru/images/beton/28gidrosoor/1200px-___.jpg', 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', NULL, 45),
(572, '2019-04-09', 0, 0, 'https://a.d-cd.net/85cde88s-960.jpg', NULL, 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 140),
(573, '2019-03-28', 0, 0, 'https://kupit-kota.ru/wp-content/uploads/2022/07/kak-uhajivat-za-kotenkom.jpeg', NULL, 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 39),
(574, '2019-03-16', 0, 0, 'http://s2.fotokto.ru/photo/full/134/1341831.jpg', 'https://www.shutterstock.com/shutterstock/videos/1066323100/preview/stock-footage-care-and-maintenance-of-animals-at-home-domestic-adorable-tabby-cat-is-eating-its-dry-food-from.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 27),
(575, '2019-03-04', 0, 0, NULL, NULL, 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 49);
