(632, '2022-04-17', 0, 0, 'https://www.mirf.ru/wp-content/uploads/2021/02/Disco-Elysium-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 29),
