(641, '2021-12-30', 0, 0, 'https://s1.1zoom.me/big3/341/Fantastic_world_441089.jpg', 'https://www.shutterstock.com/shutterstock/videos/19252600/preview/stock-footage-people-work-at-assembly-of-cars-on-conveyor-of-factory.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 72),
