(676, '2020-11-05', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/6924577/preview/stock-footage-detail-of-rusty-old-car-orange-decay-aged-vintage-lada-chrome-pan.webm', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 89),
(677, '2020-10-24', 0, 0, 'https://gas-kvas.com/uploads/posts/2022-06/1655260487_39-gas-kvas-com-p-kotik-foto-zhivotnogo-43.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 135),
(678, '2020-10-12', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1085421791/preview/stock-footage-bengal-cat-licking-water-from-glass-creative-idea-unusual-view-shot-at-fps-from-the-bottom.webm', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 151),
