(697, '2020-02-27', 0, 0, 'https://bugaga.ru/uploads/posts/2017-03/1489051999_kotik-hosiko-23.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', NULL, 44),
(698, '2020-02-15', 0, 0, 'https://www.beton-kostroma.ru/images/beton/28gidrosoor/1200px-___.jpg', NULL, NULL, 73),
(699, '2020-02-03', 0, 0, 'https://img4.badfon.ru/original/4000x2507/c/aa/linii-elektroperedachi-6037.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 118),
(700, '2020-01-22', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTysfKKw4oMZJOcVnMgdbusnjFf23anvwHTncF5vgWarYu2Efzusq1rn2iC2_BPLr0kJtM&usqp=CAU', NULL, 'А у меня по-прежнему все хорошо.', 41),
(701, '2020-01-10', 0, 0, 'https://mir-s3-cdn-cf.behance.net/project_modules/1400/90e55899496747.5ef3e8dc35854.jpg', 'https://www.shutterstock.com/shutterstock/videos/19252600/preview/stock-footage-people-work-at-assembly-of-cars-on-conveyor-of-factory.webm', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 18),
(702, '2019-12-29', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 78),
(703, '2019-12-17', 0, 0, 'https://mir-s3-cdn-cf.behance.net/project_modules/1400/90e55899496747.5ef3e8dc35854.jpg', 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'А у меня по-прежнему все хорошо.', 37),
(704, '2019-12-05', 0, 0, 'https://dailymoscow.ru/storage/news/2022/11/10/1e31496bf0b99e730ec1ffef86e5ef70.jpg', NULL, 'А у меня по-прежнему все хорошо.', 63),
(705, '2019-11-23', 0, 0, NULL, NULL, 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 46),
(706, '2019-11-11', 0, 0, 'https://tn.fishki.net/26/upload/post/2016/08/18/2046804/b449271d549f7b7bf7274d6337dbd2d6.jpg', 'https://www.shutterstock.com/shutterstock/videos/1060433290/preview/stock-footage-modern-architecture-detail-contemporary-minimal-concrete-wall-pattern-in-summer-sunlight-sun.webm', 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 136),
(707, '2019-10-30', 0, 0, NULL, NULL, 'Чек-лист: как избежать ошибок при составлении резюме.', 20),
(708, '2019-10-18', 0, 0, NULL, NULL, 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 109),
(709, '2019-10-06', 0, 0, 'https://technicalcity.b-cdn.net/en/game_image/644/image?thumbnail=yes&maxwidth=400&maxheight=400&webp=1', NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 51),
(710, '2019-09-24', 0, 0, 'https://a.d-cd.net/85cde88s-960.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 23),
(711, '2019-09-12', 0, 0, 'https://proprikol.ru/wp-content/uploads/2020/09/kartinki-lep-37.jpg', NULL, NULL, 14),
(712, '2019-08-31', 0, 0, 'https://www.avtogermes.ru/images/models/exterior/89af70891210feb93a0f2dcf5698d3f6.jpg', NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 23),
(713, '2019-08-19', 0, 0, 'https://fikiwiki.com/uploads/posts/2022-02/1645018236_6-fikiwiki-com-p-kartinki-lep-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 93),
(714, '2019-08-07', 0, 0, 'https://avatars.mds.yandex.net/i?id=6fed043a5d056146a91d6066c4900318bac12f69-8277774-images-thumbs&n=13&exp=1', NULL, 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 8),
(715, '2019-07-26', 0, 0, 'https://ждвокзалы.рф/wp-content/uploads/2019/03/snp2013_20.jpg', NULL, 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 13),
(716, '2019-07-14', 0, 0, 'https://fikiwiki.com/uploads/posts/2022-02/1645018236_6-fikiwiki-com-p-kartinki-lep-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', 'Щенки хаски', 98);
