(717, '2019-07-02', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTysfKKw4oMZJOcVnMgdbusnjFf23anvwHTncF5vgWarYu2Efzusq1rn2iC2_BPLr0kJtM&usqp=CAU', 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 35),
