(722, '2019-05-03', 0, 0, 'https://tn.fishki.net/26/upload/post/2016/08/18/2046804/b449271d549f7b7bf7274d6337dbd2d6.jpg', NULL, 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 143),
(723, '2019-04-21', 0, 0, 'https://a.d-cd.net/e7b0889s-960.jpg', 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', NULL, 45),
(724, '2019-04-09', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm', 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 140),
(725, '2019-03-28', 0, 0, 'https://kartinkin.net/pics/uploads/posts/2022-09/thumbs/1662235680_12-kartinkin-net-p-kosmicheskii-retro-futurizm-sssr-kosmos-14.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057849519/preview/stock-footage-hd-timelapse-construction-of-a-glass-building.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 39),
(726, '2019-03-16', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTysfKKw4oMZJOcVnMgdbusnjFf23anvwHTncF5vgWarYu2Efzusq1rn2iC2_BPLr0kJtM&usqp=CAU', NULL, NULL, 27),
(727, '2019-03-04', 0, 0, 'https://kupit-kota.ru/wp-content/uploads/2022/07/kak-uhajivat-za-kotenkom.jpeg', 'https://www.shutterstock.com/shutterstock/videos/19252600/preview/stock-footage-people-work-at-assembly-of-cars-on-conveyor-of-factory.webm', 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 49),
(728, '2019-02-20', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm', 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 114),
