(742, '2018-09-05', 0, 0, NULL, NULL, 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 108),
(743, '2018-08-24', 0, 0, NULL, NULL, 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 62),
