(802, '2021-09-13', 0, 0, 'https://wildfrontier.ru/wp-content/uploads/2015/09/Kapibara6.jpg', NULL, 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 66),
(803, '2021-09-01', 0, 0, 'https://max-cars.ru/wp-content/uploads/2022/07/6c0bb65a-89af-41d0-ba27-7d92c6acfc0d.jpg', NULL, 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 16),
