(816, '2021-03-29', 0, 0, 'https://s5o.ru/storage/simple/cyber/edt/00/24/73/cd/cybered8aae50a74.jpg', NULL, 'Эвакуация автомобилей, микроавтобусов с выездом к месту поломки в любую точку Москвы и Московской области.\r\nГрузоподъёмность до 3 тонн.', 146),
(817, '2021-03-17', 0, 0, 'https://max-cars.ru/wp-content/uploads/2022/07/6c0bb65a-89af-41d0-ba27-7d92c6acfc0d.jpg', 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 55),
(818, '2021-03-05', 0, 0, 'https://cs7.pikabu.ru/post_img/2018/09/06/3/og_og_15362054642621558.jpg', 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 87),
(819, '2021-02-21', 0, 0, 'https://i.artfile.ru/1600x1200_597669_[www.ArtFile.ru].jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 122),
(820, '2021-02-09', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 115),
(821, '2021-01-28', 0, 0, 'https://kupit-kota.ru/wp-content/uploads/2022/07/kak-uhajivat-za-kotenkom.jpeg', 'https://www.shutterstock.com/shutterstock/videos/6924577/preview/stock-footage-detail-of-rusty-old-car-orange-decay-aged-vintage-lada-chrome-pan.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 5),
