(844, '2020-04-27', 0, 0, 'https://bitoflife.ru/wp-content/uploads/2018/09/s12009.jpg', NULL, 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 77),
(845, '2020-04-15', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 17),
(846, '2020-04-03', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSb8s-Dpkfa1rrPV9WCLNylA3S8y7EH5TLUH6nD7ef7v76QBp_LSBgEDSKRoXuKs1qvxaY&usqp=CAU', 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 50),
(847, '2020-03-22', 0, 0, NULL, NULL, 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 57);
