(855, '2019-12-17', 0, 0, 'https://oir.mobi/uploads/posts/2022-07/1658192056_58-oir-mobi-p-retro-futurizm-art-59.jpg', NULL, 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 37),
(856, '2019-12-05', 0, 0, 'https://www.zr.ru/d/story/c3/917443/57839949_2015562468554141_1595085059130392576_o.jpg', 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 63),
(857, '2019-11-23', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 46),
(858, '2019-11-11', 0, 0, 'https://cdnstatic.rg.ru/uploads/images/168/34/61/56.jpg', 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 136),
(859, '2019-10-30', 0, 0, 'http://chudo-prirody.com/uploads/posts/2021-08/1628647490_127-p-udivlennii-kot-foto-133.jpg', 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', NULL, 20),
(860, '2019-10-18', 0, 0, 'https://fikiwiki.com/uploads/posts/2022-02/1645018228_1-fikiwiki-com-p-kartinki-lep-2.jpg', 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 109),
