(869, '2019-07-02', 0, 0, 'https://mir-s3-cdn-cf.behance.net/project_modules/1400/90e55899496747.5ef3e8dc35854.jpg', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 35),
