(871, '2019-06-08', 0, 0, 'https://storage.myseldon.com/news-pict-a6/A6C8D377880141003305AA9B3F31AF3B', 'https://www.shutterstock.com/shutterstock/videos/19252600/preview/stock-footage-people-work-at-assembly-of-cars-on-conveyor-of-factory.webm', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 125),
(872, '2019-05-27', 0, 0, 'https://wildfrontier.ru/wp-content/uploads/2015/09/Kapibara6.jpg', 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', NULL, 88),
(873, '2019-05-15', 0, 0, 'https://bitoflife.ru/wp-content/uploads/2018/09/s12009.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 103),
