(891, '2018-10-11', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 90),
(892, '2018-09-29', 0, 0, 'https://i.cenyavto.com/2021/11/QlqC.jpg', 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 131),
