(953, '2022-11-07', 0, 0, NULL, NULL, 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 21),
(954, '2022-10-26', 0, 0, 'https://i.cenyavto.com/2021/11/QlqC.jpg', 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', 'Тренды в дизайне интерьера весна-лето 2020.\r\nВ 2020 году в тренде минимализм, эко и прованс.\r\nЕсли вы хотите попробовать дизайн интерьера в этих стилях, вот несколько идей по оформлению жилых помещений.', 15),
