(961, '2022-08-03', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-09/1662679280_6-gamerwall-pro-p-retrofuturizm-sssr-arkhitektura-vkontakte-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 24),
(962, '2022-07-22', 0, 0, 'https://dailymoscow.ru/storage/news/2022/11/10/1e31496bf0b99e730ec1ffef86e5ef70.jpg', NULL, 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 40),
(963, '2022-07-10', 0, 0, 'https://avatars.mds.yandex.net/i?id=6fed043a5d056146a91d6066c4900318bac12f69-8277774-images-thumbs&n=13&exp=1', 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 129),
(964, '2022-06-28', 0, 0, NULL, NULL, 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 97),
(965, '2022-06-16', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1085421791/preview/stock-footage-bengal-cat-licking-water-from-glass-creative-idea-unusual-view-shot-at-fps-from-the-bottom.webm', NULL, 43),
(966, '2022-06-04', 0, 0, 'https://i.ytimg.com/vi/W8p9rI3JHCo/maxresdefault.jpg', 'https://www.shutterstock.com/shutterstock/videos/1080491531/preview/stock-footage-the-concrete-mixer-at-the-plant-the-concrete-mixer-at-the-industrial-plant-the-concrete-mixer.webm', 'Рекламу услуг по ремонту компьютеров, телефонов и телевизоров предлагают разместить в вагонах метро.', 2),
(967, '2022-05-23', 0, 0, 'https://kuznitsaspb.ru/wp-content/uploads/9/1/7/91758da85f7a04c8874eec4e05c5d590.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1066323100/preview/stock-footage-care-and-maintenance-of-animals-at-home-domestic-adorable-tabby-cat-is-eating-its-dry-food-from.webm', 'Рекламу услуг по ремонту компьютеров, телефонов и телевизоров предлагают разместить в вагонах метро.', 52),
(968, '2022-05-11', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-09/1662679280_6-gamerwall-pro-p-retrofuturizm-sssr-arkhitektura-vkontakte-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm', 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 132),
(969, '2022-04-29', 0, 0, NULL, NULL, NULL, 134),
(970, '2022-04-17', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-03/1646373092_9-gamerwall-pro-p-retrofuturizm-sssr-kosmos-krasivie-oboi-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 29),
(971, '2022-04-05', 0, 0, 'https://na-dache.pro/uploads/posts/2021-05/1620673970_5-p-panelnii-dom-foto-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1069766158/preview/stock-footage-an-aerial-drone-video-of-a-russian-made-lada-niva-x-driving-off-road-along-a-dirt-track-in.webm', 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 32),
(972, '2022-03-24', 0, 0, 'https://wildfrontier.ru/wp-content/uploads/2015/09/Kapibara6.jpg', 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', NULL, 111),
