(975, '2022-02-16', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1093912751/preview/stock-footage-lada-hitam-black-pepper-in-sedli-johor.webm', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 133),
(976, '2022-02-04', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 68),
(977, '2022-01-23', 0, 0, 'https://perevozki-stolitsa.ru/wp-content/uploads/2019/04/Novaya-Buhanka-UAZ-Kombi-Trofi.jpg', NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 117),
(978, '2022-01-11', 0, 0, 'https://club.season.ru/uploads/post/3858/853/post-3858-1572343853.jpg', 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 12),
(979, '2021-12-30', 0, 0, 'https://kartinkin.net/pics/uploads/posts/2022-08/1659363914_14-kartinkin-net-p-sovetskii-gorod-art-oboi-19.jpg', 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 72),
(980, '2021-12-18', 0, 0, NULL, NULL, 'Цветовая гамма: белый, черный.\r\nВысота: 2000 мм.\r\nШирина: 600 мм\r\n+ Стенка в гостиную  Ариадна  с фасадами МДФ\r\nГабаритные размеры ВхШхГ 2050x2950x420 мм.\r\nСтенд «Ариада» — стильный и одновременно функциональный предмет обстановки.', 33),
(981, '2021-12-06', 0, 0, NULL, NULL, NULL, 60),
(982, '2021-11-24', 0, 0, 'https://www.beton-kostroma.ru/images/beton/28gidrosoor/1200px-___.jpg', NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 83),
(983, '2021-11-12', 0, 0, NULL, NULL, 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 127),
(984, '2021-10-31', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646933141_5-kartinkin-net-p-kapibara-kartinki-5.jpg', NULL, 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 76),
(985, '2021-10-19', 0, 0, NULL, NULL, 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 106),
(986, '2021-10-07', 0, 0, 'https://autozam.ru/wp-content/uploads/2019/03/post_5c80c109e73fd.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 54),
(987, '2021-09-25', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1069766158/preview/stock-footage-an-aerial-drone-video-of-a-russian-made-lada-niva-x-driving-off-road-along-a-dirt-track-in.webm', 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 128),
(988, '2021-09-13', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 66),
(989, '2021-09-01', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 16),
(990, '2021-08-20', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 81),
