(1053, '2019-07-26', 0, 0, NULL, NULL, 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 13),
