(1055, '2019-07-02', 0, 0, 'https://i.pinimg.com/originals/69/87/f0/6987f0ac3f13038eaeec07299b9b72a3.jpg', NULL, 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 35),
