(1061, '2019-04-21', 0, 0, NULL, NULL, 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 45),
(1062, '2019-04-09', 0, 0, 'https://bitoflife.ru/wp-content/uploads/2018/09/s12009.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 140),
