(1090, '2018-05-08', 0, 0, NULL, 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 30),
(1091, '2018-04-26', 0, 0, 'https://fotorelax.ru/wp-content/uploads/2016/03/Funny-and-cute-cats-04.jpg', NULL, 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 112),
(1092, '2018-04-14', 0, 0, NULL, NULL, 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 85),
(1093, '2018-04-02', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', NULL, 9),
(1094, '2018-03-21', 0, 0, 'https://kupit-kota.ru/wp-content/uploads/2022/07/kak-uhajivat-za-kotenkom.jpeg', NULL, 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 56),
(1095, '2018-03-09', 0, 0, 'https://bugaga.ru/uploads/posts/2017-03/1489051999_kotik-hosiko-23.jpg', NULL, 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 130),
(1096, '2018-02-25', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646933139_7-kartinkin-net-p-kapibara-kartinki-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/6924577/preview/stock-footage-detail-of-rusty-old-car-orange-decay-aged-vintage-lada-chrome-pan.webm', NULL, 31),
(1097, '2018-02-13', 0, 0, 'https://www.vladtime.ru/uploads/posts/2018-12/1544102812_1.jpg', NULL, 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 26),
