(1124, '2022-03-24', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 111),
