(1318, '2022-01-23', 0, 0, 'https://195004.selcdn.ru/ref/vehicle/165739_9638394a01.jpeg', NULL, 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 117),
(1319, '2022-01-11', 0, 0, 'https://voms.ru/upload/iblock/959/95957d207137db849150eca86265e77d.jpg', 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', NULL, 12),
