(1321, '2021-12-18', 0, 0, 'https://million-wallpapers.ru/wallpapers/5/5/15358753003924037261/milyj-kotenok-s-podognutymi-lapkami.jpg', 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 33),
(1322, '2021-12-06', 0, 0, 'https://autozam.ru/wp-content/uploads/2019/03/post_5c80c109e73fd.jpeg', NULL, NULL, 60),
(1323, '2021-11-24', 0, 0, 'https://kuznitsaspb.ru/wp-content/uploads/7/e/4/7e4de76a2777cab9650062c72d0ba43c.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', NULL, 83),
(1324, '2021-11-12', 0, 0, 'https://fb.ru/misc/i/gallery/70335/2243351.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 127),
(1325, '2021-10-31', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 76),
(1326, '2021-10-19', 0, 0, 'https://na-dache.pro/uploads/posts/2021-05/1620673970_5-p-panelnii-dom-foto-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', NULL, 106),
(1327, '2021-10-07', 0, 0, 'https://mir-s3-cdn-cf.behance.net/project_modules/1400/90e55899496747.5ef3e8dc35854.jpg', 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 54),
(1328, '2021-09-25', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 128),
(1329, '2021-09-13', 0, 0, 'https://www.zr.ru/d/story/c3/917443/57839949_2015562468554141_1595085059130392576_o.jpg', NULL, 'К сожалению, в городе Боровая и регионе купить детскую одежду оптом невозможно.', 66),
(1330, '2021-09-01', 0, 0, 'https://s1.1zoom.me/big3/341/Fantastic_world_441089.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 16),
(1331, '2021-08-20', 0, 0, NULL, NULL, NULL, 81),
(1332, '2021-08-08', 0, 0, 'https://fotorelax.ru/wp-content/uploads/2016/03/Funny-and-cute-cats-04.jpg', NULL, NULL, 65),
