(1334, '2021-07-15', 0, 0, 'https://hub.ldpr.ru/media/images/leningrad/2bb8c1d9a94c6fd75706f87dddce49990a34b14911c69adb020dbefc86dfd78a.jpg', 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', NULL, 71),
(1335, '2021-07-03', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSh2QI9OiumzqTz_CxXgS0V3CnE2F9Cagr9oA&usqp=CAU', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', NULL, 92),
(1336, '2021-06-21', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm', 'Я хочу сделать простую функцию, которая будет читать строку из файла и возвращать все первые N слов.', 107),
(1337, '2021-06-09', 0, 0, NULL, NULL, 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 6),
(1338, '2021-05-28', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 11),
(1339, '2021-05-16', 0, 0, 'https://proprikol.ru/wp-content/uploads/2020/09/kartinki-lep-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', NULL, 59),
(1340, '2021-05-04', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 142),
(1341, '2021-04-22', 0, 0, NULL, 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'Эвакуация автомобилей, микроавтобусов с выездом к месту поломки в любую точку Москвы и Московской области.\r\nГрузоподъёмность до 3 тонн.', 64),
