(1344, '2021-03-17', 0, 0, 'https://stroymasterok.com/wp-content/uploads/2022/09/1584875492_19.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', NULL, 55),
(1345, '2021-03-05', 0, 0, 'https://club.season.ru/uploads/post/3858/853/post-3858-1572343853.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'Цветовая гамма: белый, черный.\r\nВысота: 2000 мм.\r\nШирина: 600 мм\r\n+ Стенка в гостиную  Ариадна  с фасадами МДФ\r\nГабаритные размеры ВхШхГ 2050x2950x420 мм.\r\nСтенд «Ариада» — стильный и одновременно функциональный предмет обстановки.', 87),
(1346, '2021-02-21', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 122),
