(1349, '2021-01-16', 0, 0, 'https://avatars.dzeninfra.ru/get-zen_doc/3514290/pub_5fb64713b543ac74804f9b1b_5fb656f7b543ac74806dbfcf/scale_1200', 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 70),
