(1370, '2020-05-09', 0, 0, NULL, 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 75),
