(1385, '2019-11-11', 0, 0, 'https://china-cosm.ru/wp-content/uploads/2/b/2/2b28a366e7cf29ece21a9d7d00aa327d.jpeg', NULL, 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 136),
(1386, '2019-10-30', 0, 0, 'https://a.d-cd.net/e7b0889s-960.jpg', NULL, 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 20),
(1387, '2019-10-18', 0, 0, 'https://kuznitsaspb.ru/wp-content/uploads/9/1/7/91758da85f7a04c8874eec4e05c5d590.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 109),
