(1390, '2019-09-12', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSb8s-Dpkfa1rrPV9WCLNylA3S8y7EH5TLUH6nD7ef7v76QBp_LSBgEDSKRoXuKs1qvxaY&usqp=CAU', 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 14),
