(1415, '2018-11-16', 0, 0, 'https://technicalcity.b-cdn.net/en/game_image/644/image?thumbnail=yes&maxwidth=400&maxheight=400&webp=1', NULL, 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 137),
