(1437, '2018-02-25', 0, 0, 'https://img.zr.ru/_ah/img/1jtQE2MLzuF6NUK2VaS6CA', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 31),
