(1440, '2018-01-20', 0, 0, 'https://dailymoscow.ru/storage/news/2022/11/10/1e31496bf0b99e730ec1ffef86e5ef70.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 99),
(1441, '2023-01-06', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-09/1662679280_6-gamerwall-pro-p-retrofuturizm-sssr-arkhitektura-vkontakte-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 150),
(1442, '2022-12-25', 0, 0, 'https://www.gradicom.ru/wa-data/public/shop/products/93/33/13393/images/56390/56390.970.jpg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', NULL, 150),
(1443, '2022-12-13', 0, 0, NULL, NULL, 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 150),
(1444, '2022-12-01', 0, 0, 'https://nashagazeta.ch/sites/default/files/3_c_javier_miguel_valerme.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', 'Щенки хаски', 150),
(1445, '2022-11-19', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1080491531/preview/stock-footage-the-concrete-mixer-at-the-plant-the-concrete-mixer-at-the-industrial-plant-the-concrete-mixer.webm', 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 150),
(1446, '2022-11-07', 0, 0, 'https://club.season.ru/uploads/post/3858/853/post-3858-1572343853.jpg', 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 150),
(1447, '2022-10-26', 0, 0, 'https://china-cosm.ru/wp-content/uploads/2/b/2/2b28a366e7cf29ece21a9d7d00aa327d.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 150),
(1448, '2022-10-14', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1042820053/preview/stock-footage-stone-rocks-ternoshorska-lada-amidst-beautiful-scenic-carpathian-forests-ukraine.webm', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 150),
(1449, '2022-10-02', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTysfKKw4oMZJOcVnMgdbusnjFf23anvwHTncF5vgWarYu2Efzusq1rn2iC2_BPLr0kJtM&usqp=CAU', 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 150),
