(1452, '2022-08-27', 0, 0, 'https://million-wallpapers.ru/wallpapers/5/5/15358753003924037261/milyj-kotenok-s-podognutymi-lapkami.jpg', NULL, 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 150),
(1453, '2022-08-15', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 150),
