(1471, '2022-01-11', 0, 0, 'https://dailymoscow.ru/storage/news/2022/11/10/1e31496bf0b99e730ec1ffef86e5ef70.jpg', 'https://www.shutterstock.com/shutterstock/videos/1080491531/preview/stock-footage-the-concrete-mixer-at-the-plant-the-concrete-mixer-at-the-industrial-plant-the-concrete-mixer.webm', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 150),
(1472, '2021-12-30', 0, 0, 'https://kuznitsaspb.ru/wp-content/uploads/7/e/4/7e4de76a2777cab9650062c72d0ba43c.jpeg', NULL, 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 150),
