(1485, '2021-07-27', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1093912751/preview/stock-footage-lada-hitam-black-pepper-in-sedli-johor.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 150),
(1486, '2021-07-15', 0, 0, 'https://oir.mobi/uploads/posts/2020-01/1580285391_7-p-sovetskie-retrofuturizmi-13.jpg', 'https://www.shutterstock.com/shutterstock/videos/1069766158/preview/stock-footage-an-aerial-drone-video-of-a-russian-made-lada-niva-x-driving-off-road-along-a-dirt-track-in.webm', 'Эвакуация автомобилей, микроавтобусов с выездом к месту поломки в любую точку Москвы и Московской области.\r\nГрузоподъёмность до 3 тонн.', 150),
(1487, '2021-07-03', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 150),
(1488, '2021-06-21', 0, 0, 'https://proprikol.ru/wp-content/uploads/2020/09/kartinki-lep-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 150),
(1489, '2021-06-09', 0, 0, 'https://bitoflife.ru/wp-content/uploads/2018/09/s12009.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm', 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 150),
