(1506, '2020-11-17', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 150),
