(1510, '2020-09-30', 0, 0, NULL, NULL, 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 150),
