(1534, '2019-12-17', 0, 0, 'https://mobimg.b-cdn.net/v3/fetch/35/35bd14603db3e0657d710da1faedcc63.jpeg?w=1600', 'https://www.shutterstock.com/shutterstock/videos/1069766158/preview/stock-footage-an-aerial-drone-video-of-a-russian-made-lada-niva-x-driving-off-road-along-a-dirt-track-in.webm', 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 150),
(1535, '2019-12-05', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-09/1662679280_6-gamerwall-pro-p-retrofuturizm-sssr-arkhitektura-vkontakte-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 150),
(1536, '2019-11-23', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm', NULL, 150),
(1537, '2019-11-11', 0, 0, 'https://proprikol.ru/wp-content/uploads/2020/09/kartinki-lep-37.jpg', 'https://www.shutterstock.com/shutterstock/videos/1060433290/preview/stock-footage-modern-architecture-detail-contemporary-minimal-concrete-wall-pattern-in-summer-sunlight-sun.webm', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 150),
(1538, '2019-10-30', 0, 0, 'https://www.zr.ru/d/story/c3/917443/57839949_2015562468554141_1595085059130392576_o.jpg', 'https://www.shutterstock.com/shutterstock/videos/1095340209/preview/stock-footage-aerial-view-of-a-car-driving-on-the-road-in-a-field.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 150),
(1539, '2019-10-18', 0, 0, NULL, NULL, NULL, 150),
