(1541, '2019-09-24', 0, 0, 'https://mir-s3-cdn-cf.behance.net/project_modules/1400/90e55899496747.5ef3e8dc35854.jpg', NULL, 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 150),
