(1549, '2019-06-20', 0, 0, 'http://s1.fotokto.ru/photo/full/187/1870925.jpg', 'https://www.shutterstock.com/shutterstock/videos/1086439826/preview/stock-footage-elevated-aerial-view-of-blue-car-vehicle-automobile-in-fast-drive-motion-on-countryside-country.webm', 'После того, как  Роснано  инвестировало в проект строительства завода по производству поликристаллического кремния в Армении, компания планирует вложить еще 100 миллионов долларов в производство полупроводников.', 150),
(1550, '2019-06-08', 0, 0, NULL, NULL, NULL, 150),
(1551, '2019-05-27', 0, 0, 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSb8s-Dpkfa1rrPV9WCLNylA3S8y7EH5TLUH6nD7ef7v76QBp_LSBgEDSKRoXuKs1qvxaY&usqp=CAU', 'https://www.shutterstock.com/shutterstock/videos/1080491531/preview/stock-footage-the-concrete-mixer-at-the-plant-the-concrete-mixer-at-the-industrial-plant-the-concrete-mixer.webm', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 150),
(1552, '2019-05-15', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-03/1646373092_9-gamerwall-pro-p-retrofuturizm-sssr-kosmos-krasivie-oboi-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm', NULL, 150),
(1553, '2019-05-03', 0, 0, 'https://nashagazeta.ch/sites/default/files/3_c_javier_miguel_valerme.jpeg', NULL, 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 150),
(1554, '2019-04-21', 0, 0, 'https://www.zr.ru/d/story/c3/917443/57839949_2015562468554141_1595085059130392576_o.jpg', NULL, 'Цветовая гамма: белый, черный.\r\nВысота: 2000 мм.\r\nШирина: 600 мм\r\n+ Стенка в гостиную  Ариадна  с фасадами МДФ\r\nГабаритные размеры ВхШхГ 2050x2950x420 мм.\r\nСтенд «Ариада» — стильный и одновременно функциональный предмет обстановки.', 150),
(1555, '2019-04-09', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931791_15-kartinkin-net-p-kartinki-elektrichek-17.jpg', 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 150),
(1556, '2019-03-28', 0, 0, 'https://wildfrontier.ru/wp-content/uploads/2015/09/Kapibara6.jpg', NULL, 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 150),
