(1559, '2019-02-20', 0, 0, 'https://mobimg.b-cdn.net/v3/fetch/35/35bd14603db3e0657d710da1faedcc63.jpeg?w=1600', NULL, 'Полиэтиленовая пленка хорошо удерживает тепло, водо- и паронепроницаема, обладает высокой прочностью, эластична и прозрачна. Пленка удобна при транспортировке в виду своего минимального веса и объема и возможности проведения визуального контроля товара', 150),
