(1564, '2018-12-22', 0, 0, 'https://kartinkin.net/uploads/posts/2022-03/1646931816_37-kartinkin-net-p-kartinki-elektrichek-45.jpg', NULL, 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 150),
(1565, '2018-12-10', 0, 0, 'https://kuznitsaspb.ru/wp-content/uploads/7/e/4/7e4de76a2777cab9650062c72d0ba43c.jpeg', NULL, 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', 150),
(1566, '2018-11-28', 0, 0, 'https://photos.wikimapia.org/p/00/06/81/21/72_full.jpg', 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 150),
(1567, '2018-11-16', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/6924577/preview/stock-footage-detail-of-rusty-old-car-orange-decay-aged-vintage-lada-chrome-pan.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 150),
(1568, '2018-11-04', 0, 0, 'https://na-dache.pro/uploads/posts/2021-05/1620673970_5-p-panelnii-dom-foto-7.jpg', NULL, 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 150),
(1569, '2018-10-23', 0, 0, 'https://dailymoscow.ru/storage/news/2022/11/10/1e31496bf0b99e730ec1ffef86e5ef70.jpg', NULL, 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 150),
