INSERT INTO `group_record` (`id_group_record`, `date_record`, `dislike_count`, `like_count`, `img_src`, `video_src`, `text`, `id_group`) VALUES
(1576, '2018-07-31', 0, 0, 'https://gamerwall.pro/uploads/posts/2022-09/1662679280_6-gamerwall-pro-p-retrofuturizm-sssr-arkhitektura-vkontakte-7.jpg', 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm', NULL, 150),
(1577, '2018-07-19', 0, 0, NULL, NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 150),
(1578, '2018-07-07', 0, 0, 'https://www.gradicom.ru/wa-data/public/shop/products/93/33/13393/images/56390/56390.970.jpg', 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', 'В рамках Всероссийского Дня правовой помощи детям в отделе ЗАГС администрации г. Чебоксары состоялся семинар-совещание с сотрудниками отделов ЗАГС администраций районов города Чебоксары и города Новочебоксарска.', 150),
(1579, '2018-06-25', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 150),
(1580, '2018-06-13', 0, 0, 'https://oir.mobi/uploads/posts/2022-07/1658192056_58-oir-mobi-p-retro-futurizm-art-59.jpg', 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm', NULL, 150),
(1581, '2018-06-01', 0, 0, 'https://www.beton-kostroma.ru/images/beton/28gidrosoor/1200px-___.jpg', 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm', 'Тренды в дизайне интерьера весна-лето 2020.\r\nВ 2020 году в тренде минимализм, эко и прованс.\r\nЕсли вы хотите попробовать дизайн интерьера в этих стилях, вот несколько идей по оформлению жилых помещений.', 150),
(1582, '2018-05-20', 0, 0, 'https://carsweek.ru/upload/resize_cache/iblock/8a0/1200_900_1/8a055f1cf1329fa717b834734790e3c6.jpg', NULL, 'Блин, просто не понимаю, почему так много людей считают, что в этом мире все так просто?', 150),
(1583, '2018-05-08', 0, 0, 'https://www.mirf.ru/wp-content/uploads/2021/02/Disco-Elysium-1.jpg', 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 150),
(1584, '2018-04-26', 0, 0, 'https://nashagazeta.ch/sites/default/files/3_c_javier_miguel_valerme.jpeg', 'https://www.shutterstock.com/shutterstock/videos/1057411735/preview/stock-footage-white-red-cat-kitten-plays-on-a-green-background-screen.webm', NULL, 150),
(1585, '2018-04-14', 0, 0, 'https://avatars.mds.yandex.net/get-autoru-vos/2163817/a3e40a1c287938ec391f1ce3db8a7f3c/1200x900n', 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm', NULL, 150),
(1586, '2018-04-02', 0, 0, 'https://railgallery.ru/photo/00/50/82/50822.jpg', NULL, 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 150),
(1587, '2018-03-21', 0, 0, 'https://kartinkin.net/pics/uploads/posts/2022-09/thumbs/1662235680_12-kartinkin-net-p-kosmicheskii-retro-futurizm-sssr-kosmos-14.jpg', 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm', 'Эвакуация автомобилей, микроавтобусов с выездом к месту поломки в любую точку Москвы и Московской области.\r\nГрузоподъёмность до 3 тонн.', 150),
(1588, '2018-03-09', 0, 0, 'https://i.cenyavto.com/2021/11/QlqC.jpg', NULL, 'Я хочу сделать простую функцию, которая будет читать строку из файла и возвращать все первые N слов.', 150),
(1589, '2018-02-25', 0, 0, 'https://million-wallpapers.ru/wallpapers/5/5/15358753003924037261/milyj-kotenok-s-podognutymi-lapkami.jpg', 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm', NULL, 150),
(1590, '2018-02-13', 0, 0, NULL, 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 150),
(1591, '2018-02-01', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm', NULL, 150),
(1592, '2018-01-20', 0, 0, NULL, 'https://www.shutterstock.com/shutterstock/videos/1057849519/preview/stock-footage-hd-timelapse-construction-of-a-glass-building.webm', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 150);
