(5, 29, '2023-01-05 00:00:00', 'Так вот, мне снился сон, что я просыпаюсь, иду на кухню за кофе, а там стоит моя мама и пьет мой кофе. Ну я, естественно, говорю ей \"Привет\", а она мне \"Ты же умер!\"', NULL, 0, 0, NULL),
