(105, 29, '2022-12-25 00:00:00', 'Рекламу услуг по ремонту компьютеров, телефонов и телевизоров предлагают разместить в вагонах метро.', 'https://www.vladtime.ru/uploads/posts/2018-12/1544102812_1.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm'),
