(108, 32, '2022-11-19 00:00:00', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 'https://avatars.dzeninfra.ru/get-zen_doc/3514290/pub_5fb64713b543ac74804f9b1b_5fb656f7b543ac74806dbfcf/scale_1200', 0, 0, NULL),
(109, 33, '2022-11-07 00:00:00', NULL, 'https://proprikol.ru/wp-content/uploads/2020/09/kartinki-lep-1.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm'),
(110, 34, '2022-10-26 00:00:00', NULL, NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm'),
(111, 35, '2022-10-14 00:00:00', 'Цветовая гамма: белый, черный.\r\nВысота: 2000 мм.\r\nШирина: 600 мм\r\n+ Стенка в гостиную  Ариадна  с фасадами МДФ\r\nГабаритные размеры ВхШхГ 2050x2950x420 мм.\r\nСтенд «Ариада» — стильный и одновременно функциональный предмет обстановки.', 'https://i.pinimg.com/736x/b5/fa/72/b5fa721238086248ec12a59fa4c3779e.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/15650926/preview/stock-footage-lada-niva-crosses-the-river.webm'),
(112, 36, '2022-10-02 00:00:00', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 'https://storage.myseldon.com/news-pict-a6/A6C8D377880141003305AA9B3F31AF3B', 0, 0, NULL),
(113, 37, '2022-09-20 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', NULL, 0, 0, NULL),
(114, 38, '2022-09-08 00:00:00', NULL, 'https://games.mail.ru/hotbox/content_files/Stories/2022/10/19/fe4765df7e6341f9963e5e4b4645005c.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm'),
(115, 39, '2022-08-27 00:00:00', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm'),
(116, 40, '2022-08-15 00:00:00', NULL, NULL, 0, 0, NULL),
(117, 41, '2022-08-03 00:00:00', 'Юные таланты из Приангарья могут стать участниками всероссийского конкурса.', 'https://s5o.ru/storage/simple/cyber/edt/00/24/73/cd/cybered8aae50a74.jpg', 0, 0, NULL),
(118, 42, '2022-07-22 00:00:00', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', NULL, 0, 0, NULL),
(119, 43, '2022-07-10 00:00:00', NULL, 'https://kartinkin.net/uploads/posts/2022-03/1646933139_7-kartinkin-net-p-kapibara-kartinki-7.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1085421791/preview/stock-footage-bengal-cat-licking-water-from-glass-creative-idea-unusual-view-shot-at-fps-from-the-bottom.webm'),
(120, 44, '2022-06-28 00:00:00', 'Тренды в дизайне интерьера весна-лето 2020.\r\nВ 2020 году в тренде минимализм, эко и прованс.\r\nЕсли вы хотите попробовать дизайн интерьера в этих стилях, вот несколько идей по оформлению жилых помещений.', 'https://gas-kvas.com/uploads/posts/2022-06/1655260487_39-gas-kvas-com-p-kotik-foto-zhivotnogo-43.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm'),
(121, 45, '2022-06-16 00:00:00', NULL, 'http://s2.fotokto.ru/photo/full/134/1341831.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1049497642/preview/stock-footage-old-soviet-car-old-russian-car-lada-zil-zaporogez-moskvich.webm'),
(122, 46, '2022-06-04 00:00:00', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 'https://mobimg.b-cdn.net/v3/fetch/fe/fe22186dba2df35f07573604aa8a0e63.jpeg?w=1470&r=0.5625', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1091847435/preview/stock-footage-orange-cat-resting-on-the-windowsill.webm'),
(123, 47, '2022-05-23 00:00:00', 'Я хочу сделать простую функцию, которая будет читать строку из файла и возвращать все первые N слов.', 'https://photos.wikimapia.org/p/00/02/90/56/34_big.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1061481718/preview/stock-footage-abstract-architectural-background-flying-on-a-concrete-minimalistic-interior-futuristic-modern.webm'),
(124, 48, '2022-05-11 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 'https://stroymasterok.com/wp-content/uploads/2022/09/1584875492_19.jpg', 0, 0, NULL),
(125, 49, '2022-04-29 00:00:00', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 'https://cdn-st1.rtr-vesti.ru/vh/pictures/hd/336/415/6.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm'),
(126, 50, '2022-04-17 00:00:00', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', 'https://fb.ru/misc/i/gallery/70335/2243351.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm'),
(127, 51, '2022-04-05 00:00:00', 'Немало важных дел в жизни каждого человека приходится на то время, когда он находится в школе.\r\nИ не важно, какая профессия ему предстоит, каждый должен быть готов к тому, что ему придется изучать науку, которая называется – «Педагогика».', 'https://photos.wikimapia.org/p/00/02/90/56/34_big.jpg', 0, 0, NULL),
