(137, 61, '2021-12-06 00:00:00', 'Грамматика русского языка.\r\nСборник упражнений.\r\nЧасть 1 (учебно-методическое пособие)\r\nАвтор: Голуб Ирина Борисовна, Розенталь Дитмар Эльяшевич Издательство: АСТ, 2011 г. Серия: Юным умникам и умницам\r\nАннотация к книге  Грамматика русского языка: Сборник упражнений.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTysfKKw4oMZJOcVnMgdbusnjFf23anvwHTncF5vgWarYu2Efzusq1rn2iC2_BPLr0kJtM&usqp=CAU', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1065535045/preview/stock-footage-fruit-of-a-pear-variety-lada-in-raindrops-end-of-july-moscow-region.webm'),
(138, 62, '2021-11-24 00:00:00', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/6924577/preview/stock-footage-detail-of-rusty-old-car-orange-decay-aged-vintage-lada-chrome-pan.webm'),
(139, 63, '2021-11-12 00:00:00', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 'https://cs7.pikabu.ru/post_img/2018/09/06/3/og_og_15362054642621558.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1052973047/preview/stock-footage-the-cat-sleeps-on-the-windowsill-happy-family-tricolor-cat-sleeps-on-a-window-in-the-rays-of.webm'),
