(154, 78, '2021-05-16 00:00:00', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 'https://kartinkin.net/pics/uploads/posts/2022-08/1660975105_57-kartinkin-net-p-kapibara-oboi-krasivo-67.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1092718571/preview/stock-footage-animation-of-a-modern-and-spacious-kitchen-presenting-the-same-interior-in-different-color.webm'),
(155, 79, '2021-05-04 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 'https://img.zr.ru/_ah/img/1jtQE2MLzuF6NUK2VaS6CA', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1060433290/preview/stock-footage-modern-architecture-detail-contemporary-minimal-concrete-wall-pattern-in-summer-sunlight-sun.webm'),
