(157, 81, '2021-04-10 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 'https://gas-kvas.com/uploads/posts/2022-06/1655260487_39-gas-kvas-com-p-kotik-foto-zhivotnogo-43.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1058709826/preview/stock-footage-shadows-of-the-people-on-a-concrete-wall-in-slow-motion.webm'),
(158, 82, '2021-03-29 00:00:00', 'Здарова, народ!\r\nВ этом ролике я расскажу вам о том, что случилось с моим ником, и как я его обновил.\r\nНе забудь поставить лайк и подписаться на канал, а также написать в комментариях, что ты хочешь видеть в следующем видео.\r\nПриятного просмотра!', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1053089813/preview/stock-footage-golden-retriever-and-british-shorthair-get-along.webm'),
