(172, 96, '2020-10-12 00:00:00', 'Я не знаю, что сказать, потому что я не понимаю, как это работает.\r\nВозможно, я буду объяснять, но на самом деле мне просто нужно знать, есть ли у кого-нибудь идеи.\r\nУ меня есть два изображения: одно - это изображение, которое я хочу нарисовать, а другое - изображение, которое у меня уже есть.\r\nПо сути, это все, что у меня есть, и я хочу, чтобы мое изображение было в верхнем левом углу.\r\nСначала я подумал, что было бы легко сделать это, используя setBounds, но это не сработало.', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1060433290/preview/stock-footage-modern-architecture-detail-contemporary-minimal-concrete-wall-pattern-in-summer-sunlight-sun.webm'),
