(174, 98, '2020-09-18 00:00:00', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 'https://technicalcity.b-cdn.net/en/game_image/644/image?thumbnail=yes&maxwidth=400&maxheight=400&webp=1', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm'),
