(189, 113, '2020-03-22 00:00:00', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 'https://img.zr.ru/_ah/img/1jtQE2MLzuF6NUK2VaS6CA', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1060433290/preview/stock-footage-modern-architecture-detail-contemporary-minimal-concrete-wall-pattern-in-summer-sunlight-sun.webm'),
