(192, 116, '2020-02-15 00:00:00', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm'),
(193, 117, '2020-02-03 00:00:00', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', NULL, 0, 0, NULL),
(194, 118, '2020-01-22 00:00:00', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 'https://thumbs.dreamstime.com/b/%D1%81%D0%B2%D0%B5%D1%82-%D0%B2-%D1%81%D1%83%D0%BF%D0%B5%D1%80%D0%BC%D0%B0%D1%80%D0%BA%D0%B5%D1%82%D0%B5-%D0%BD%D0%BE%D1%87%D1%8C%D1%8E-%D0%B7%D0%BD%D0%B0%D0%BA-%D1%81%D1%83%D0%BF%D0%B5%D1%80%D0%BC%D0%B0%D1%80%D0%BA%D0%B5%D1%82-pyaterochka-%D1%81%D0%B0%D1%80%D0%B0%D1%82%D0%BE%D0%B2-%D1%80%D0%BE%D1%81%D1%81%D0%B8%D1%8F-191705868.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1083245878/preview/stock-footage-time-lapse-of-a-plant-seedling-growing-in-a-crack-in-concrete-in-trying-to-survive-to-conquer.webm'),
(195, 119, '2020-01-10 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 'https://avatars.dzeninfra.ru/get-zen_doc/3514290/pub_5fb64713b543ac74804f9b1b_5fb656f7b543ac74806dbfcf/scale_1200', 0, 0, NULL),
