(199, 123, '2019-11-23 00:00:00', 'Жил-был в одной деревне мужик.\r\nИ был он таким страшным пьяницей, что соседи его и не звали больше на свадьбы и праздники.\r\nА если и звали, то он всем подряд наливал, а сам не пил, и других заставлял пить.', 'http://localhost:5000/upload/img/1.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm'),
(200, 124, '2019-11-11 00:00:00', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 'https://kartinkin.net/pics/uploads/posts/2022-08/1659363914_14-kartinkin-net-p-sovetskii-gorod-art-oboi-19.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm'),
