(214, 138, '2019-05-27 00:00:00', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 'https://autozam.ru/wp-content/uploads/2019/03/post_5c80c109e73fd.jpeg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1058955644/preview/stock-footage-cat-and-dog-playing-with-each-other.webm'),
(215, 139, '2019-05-15 00:00:00', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', 'http://chudo-prirody.com/uploads/posts/2021-08/1628647490_127-p-udivlennii-kot-foto-133.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1093912751/preview/stock-footage-lada-hitam-black-pepper-in-sedli-johor.webm'),
