(218, 142, '2019-04-09 00:00:00', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 'https://ixbt.online/live/topics/preview/00/01/94/37/5d6bdf3137.jpg', 0, 0, NULL),
