(314, 47, '2022-05-23 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 'https://kartinkin.net/pics/uploads/posts/2022-08/1660975105_57-kartinkin-net-p-kapibara-oboi-krasivo-67.jpg', 0, 0, NULL),
