(384, 117, '2020-02-03 00:00:00', 'Мы являемся производителем, специализирующихся в области электронных продуктов и решений.\r\nВ основном мы предоставляем OEM Service, что означает размер, форма и цвет продукта, логотип и дизайн упаковки может быть изменен в соответствии с требованиями заказчика.\r\nНаш завод занимает площадь около 10000 квадратных метров, с более чем 100 сотрудников.', 'https://195004.selcdn.ru/ref/vehicle/165739_9638394a01.jpeg', 0, 0, NULL),
