(410, 143, '2019-03-28 00:00:00', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', NULL, 0, 0, NULL),
(411, 144, '2019-03-16 00:00:00', 'Сценарий праздника для детей старшего дошкольного возраста «На зарядку становись!» Цель: познакомить детей с правилами утренней гимнастики; приобщить к здоровому образу жизни; способствовать развитию физических качеств: ловкости, быстроты, выносливости. развивать внимание, ориентировку в пространстве. воспитывать чувство товарищества, умение работать в коллективе.', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1063876834/preview/stock-footage-super-slow-motion-shot-of-smashing-concrete-brick-with-sledgehammer-at-fps.webm'),
