(419, 152, '2018-12-10 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 'https://technicalcity.b-cdn.net/en/game_image/644/image?thumbnail=yes&maxwidth=400&maxheight=400&webp=1', 0, 0, 'https://cdn.coverr.co/videos/coverr-putting-wood-on-a-machine-8859/1080p.mp4'),
