(430, 163, '2018-07-31 00:00:00', 'И так, на этом сайте вы можете найти все о игре и пройти игру.\r\nИгра в жанре  Поиск предметов  - это увлекательная головоломка, в которой у вас не будет времени на раздумья.\r\nВ этой игре вам предстоит помочь героям найти выход из лабиринта.\r\nНо не думайте, что это будет просто.\r\nВам придется пройти через множество испытаний, которые не так то и просто решить.\r\nСюжет игры будет понятен из названия.\r\nПо сюжету у нас есть главный герой.\r\nОн попал в лабиринт, и у него не было времени думать.', 'https://cdnstatic.rg.ru/uploads/images/168/34/61/56.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm'),
