(432, 165, '2018-07-07 00:00:00', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', 'https://fire-steel.ru/wp-content/uploads/2021/11/platform__0003.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/6924577/preview/stock-footage-detail-of-rusty-old-car-orange-decay-aged-vintage-lada-chrome-pan.webm'),
