(475, 208, '2017-02-06 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1080491531/preview/stock-footage-the-concrete-mixer-at-the-plant-the-concrete-mixer-at-the-industrial-plant-the-concrete-mixer.webm'),
