(540, 82, '2021-03-29 00:00:00', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', NULL, 0, 0, NULL),
(541, 83, '2021-03-17 00:00:00', 'Осторожно, в сети мошенники! В последнее время в интернете участились случаи мошенничества. Злоумышленники создают сайты, похожие на официальные страницы известных компаний, и предлагают клиентам получить бесплатный товар или услугу. Когда человек вводит свои персональные данные, злоумышленники получают доступ к его банковским счетам. Сотрудники МВД России предупреждают, что для того, чтобы не стать жертвой мошенников, необходимо быть бдительным.', 'https://voms.ru/upload/iblock/959/95957d207137db849150eca86265e77d.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm'),
