(566, 108, '2020-05-21 00:00:00', 'Йеллоустонский парк. Наблюдаю за тем, как люди играют в футбол. Смотрю, как они бьют по мячу, затем видят, как он летит в небо. И вдруг замечаю, что мяч летит прямо на меня!', 'https://stroymasterok.com/wp-content/uploads/2022/09/1584875492_19.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1055224196/preview/stock-footage-endless-flight-in-a-gray-concrete-tunnel-the-movement-of-the-camera-in-a-circle-solar-swap-makes.webm'),
(567, 109, '2020-05-09 00:00:00', 'У меня есть один проект, который имеет файл .csproj.\r\nВ этом файле у меня есть несколько проектов, которые зависят от других проектов.\r\nЯ хочу связать их с помощью nuget, но я хочу, чтобы они были связаны, когда я выполняю сборку (а не вручную).\r\nУ меня нет ссылки на каждый проект в файле .csproj, поэтому я попытался сделать это с помощью команды nuget pack.\r\nЭто будет связывать все проекты, а не только те, которые я сам выбрал.', 'https://www.mirf.ru/wp-content/uploads/2021/02/Disco-Elysium-1.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1057849519/preview/stock-footage-hd-timelapse-construction-of-a-glass-building.webm'),
