(583, 125, '2019-10-30 00:00:00', 'Фитбол – это гимнастический мяч, который используется в лечебной и профилактической практике.\r\nОн может применяться для занятий с детьми и взрослыми.\r\nУпражнения на нем помогают устранить или уменьшить боль в спине, устранить боли в суставах, улучшить осанку.\r\nКроме того, они воздействуют на мышцы и связки, развивают опорно-двигательный аппарат, улучшают координацию движений.\r\nРегулярные занятия на фитболе помогают избежать многих проблем со здоровьем, которые связаны со «здоровым» образом жизни.', 'https://cs7.pikabu.ru/post_img/2018/09/06/3/og_og_15362054642621558.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1058955509/preview/stock-footage-little-cat-and-dog-playing-on-the-bed.webm'),
