(636, 178, '2018-02-01 00:00:00', 'Лечение гипертонической болезни зависит от стадии заболевания, возраста больного и тяжести его состояния.\r\nВ первую очередь необходимо выявить причину повышенного давления.\r\nЕсли она установлена, то следует устранить ее.\r\nПри наличии осложнений (инфарктов, инсультов и т. д.) назначают соответствующее лечение.', NULL, 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1072102166/preview/stock-footage-motion-concrete-wall-background-sunshine-natural-shadow-d-render.webm'),
(637, 179, '2018-01-20 00:00:00', 'Опираясь на достижения предшествующих поколений исследователей, авторы сумели показать творчество и основные тенденции развития русской литературы в 1760—1830 годах.\r\nКнига рассчитана на студентов-филологов, преподавателей русского языка, а также учащихся старших классов средней школы.', 'https://kartinkin.net/pics/uploads/posts/2022-08/1660974994_5-kartinkin-net-p-kapibara-oboi-krasivo-7.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1085421791/preview/stock-footage-bengal-cat-licking-water-from-glass-creative-idea-unusual-view-shot-at-fps-from-the-bottom.webm'),
