(676, 218, '2016-10-09 00:00:00', 'Летит над миром, как орел,\r\nС огнем в глазах, в руках -- перо.\r\nИ не узнать, что впереди --\r\nНе может сердце не болеть.\r\n\r\nОткрой глаза -- и ты увидишь,\r\nКак он, взлетев на высоту,\r\nОпустится на землю рядом --\r\nВ нем нет ни зла и ни беды.\r\nОн -- человек, и он -- герой.\r\nТы не узнаешь, пока не поймешь.', 'https://club.season.ru/uploads/post/3858/853/post-3858-1572343853.jpg', 0, 0, 'https://www.shutterstock.com/shutterstock/videos/1093912751/preview/stock-footage-lada-hitam-black-pepper-in-sedli-johor.webm'),
